import React, { createContext, useState } from "react";

interface User {
  isAuthenticated: boolean;
  userId: number;
  username: string;
}

export const AuthContext =
  createContext <
  User >
  {
    isAuthenticated: null,
    userId: null,
    username: null,
  };
